        <h1>Fly-Free Cattle Starts Here</h1>
        <p>Control nuisance flies that cause discomfort on your dairy farm. ClariFly<sup>®</sup>&nbsp;Larvicide protects from disease-carrying flies that feed on dairy cattle, including house flies, stable flies and horn flies. Adding this feed-through as part of an IPM program can have a major impact on dairy cattle productivity.</p>
